import { BiHomeAlt2, BiUser, BiInfoCircle, BiLogOut } from "react-icons/bi";
import { FiFeather } from "react-icons/fi";

export default function Navbar() {
    return (
        <nav className="w-20 h-screen flex flex-col items-center bg-indigo-950 text-white text-4xl">
            <FiFeather className='h-1/4 bg-red-300'/>
            <div id='functions' className='h-1/2 bg-red-200 flex-col'>
                <BiHomeAlt2 />
                <BiUser />
                <BiLogOut />
            </div>
            <BiInfoCircle className="h-1/4 bg-red-400"/>

        </nav>
    );
};
